import React, { useState } from 'react'
import {Avatar} from '@mui/material'

const Navbar = ({isLoggedin, user}) => {
  const[navbarToggle, setNabvarToggle] = useState(false)
  const avatar = user.username !== '' ? <Avatar></Avatar> : <button></button>


  if(user.username !== ''){
    const avatar = <Avatar></Avatar>
  }else{
    const avatar = <button>Login/Signup</button>
  }
  const navbar_list = ['Home','About','Contact','Authors',avatar]
  return (
    <nav className = 'text-black p-4 flex flex-col sm:flex-row items-center justify-between bg-transparent '>
        <div className="font-bold text-xl">
            YourLogo
        </div>
        <div className=' flex flex-col sm:flex-row items-center space-x-4 mt-4 md:mt-0'>
          {navbar_list.map((title, key)=>{
            return(
              <a href='/' key={key}>{title}</a>
            ) 
          })}
        </div>
    </nav>
  )
}

export default Navbar
